import React, { Fragment, Component } from "react";
import Form from "./Form";
import Clos from "./Clos";

export class CloDashboard extends Component {
  render() {
    return (
      <div>
        <Fragment>
          <Clos />
        </Fragment>
      </div>
    );
  }
}

export default CloDashboard;
